// import Carousel from "react-bootstrap";
// import { ExampleCarouselImageOne } from "";
// import { ExampleCarouselImageTwo } from "";
// import { ExampleCarouselImageThree } from "";

import { Carousel } from "react-bootstrap";
import rock from "./../../media/images/Concert Muzica Rock_New.jpg";
import stbj from "./../../media/images/STBJ_New.jpg";
import coldplay from "./../../media/images/Coldplay_New.jpg";

function Slider() {
  return (
    <Carousel>
      <Carousel.Item interval={1000}>
        <img
          src="https://content.eventim.com/static/uploaded/at/q/s/a/2/qsa2_420_560.jpeg"
          alt="First slide"
        />
        <Carousel.Caption>
          <h3>Concert Ed Sheeran</h3>
          <p>Bucuresti, Arena Nationala</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item interval={500}>
        <img src={rock} text="Bryan Adams" />
        {/* <Carousel.Caption>
          <h3>Second slide label</h3>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
        </Carousel.Caption> */}
      </Carousel.Item>
      <Carousel.Item>
        <img src={coldplay} text="Coldplay" />
        {/* <Carousel.Caption>
          <h3>Third slide label</h3>
          <p>
            Praesent commodo cursus magna, vel scelerisque nisl consectetur.
          </p>
        </Carousel.Caption> */}
      </Carousel.Item>
    </Carousel>
  );
}

export default Slider;
